import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Locate and fill the minimum price input
    const minPriceInputSelector = '#minPrice';
    await page.waitForSelector(minPriceInputSelector, { timeout: 5000 });
    await page.fill(minPriceInputSelector, '50');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_min_price_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_min_price_filled.png'));

    // Locate and fill the maximum price input
    const maxPriceInputSelector = '#maxPrice';
    await page.waitForSelector(maxPriceInputSelector, { timeout: 5000 });
    await page.fill(maxPriceInputSelector, '100');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_max_price_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_max_price_filled.png'));

    // Locate and click the apply filter button
    const applyButtonSelector = 'button.apply-filter';
    await page.waitForSelector(applyButtonSelector, { timeout: 5000 });
    await page.click(applyButtonSelector);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_filter_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_filter_applied.png'));

    // Extract data to verify the action
    const minPriceValue = await page.inputValue(minPriceInputSelector);
    const maxPriceValue = await page.inputValue(maxPriceInputSelector);

    return {
      success: true,
      action: "Applied price range filter from 50 to 100.",
      extractedData: {
        minPrice: minPriceValue,
        maxPrice: maxPriceValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // In case of an error, return a failure object
    const screenshots = [];
    try {
      const errorScreenshotPath = path.join(screenshotsDir, 'error.png');
      await page.screenshot({ path: errorScreenshotPath });
      screenshots.push(errorScreenshotPath);
    } catch (e) {
      // Ignore if screenshot fails
    }

    return {
      success: false,
      action: "Failed to apply price range filter.",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
